DROP TABLE administrator;
DROP TABLE picture;

CREATE TABLE picture(
	pic_id INTEGER NOT NULL,
	contentType VARCHAR(50),
	image BLOB,
	PRIMARY KEY (pic_id)
);

CREATE TABLE administrator(
	email VARCHAR(50) NOT NULL,
	password VARCHAR(50) NOT NULL,
	pic_id INTEGER,
	PRIMARY KEY (email),
	FOREIGN KEY (pic_id) REFERENCES picture(pic_id) ON DELETE SET NULL
);

CREATE TABLE customer(
	email VARCHAR(50) NOT NULL,
	password VARCHAR(50) NOT NULL,
	fullName VARCHAR(50),
	gender CHAR(1),
	pic_id INTEGER,
	billingType VARCHAR(10),
	forgotPasswordHash VARCHAR(150),
	PRIMARY KEY (email),
	FOREIGN KEY (pic_id) REFERENCES picture(pic_id) ON DELETE SET NULL
);

CREATE TABLE disabledCustomer(
	email VARCHAR(50) NOT NULL,
	password VARCHAR(50) NOT NULL,
	fullName VARCHAR(50),
	gender CHAR(1),
	pic_id INTEGER,
	billingType VARCHAR(10),
	bill_id INTEGER,
	PRIMARY KEY (email),
	FOREIGN KEY (pic_id) REFERENCES picture(pic_id) ON DELETE SET NULL
);

CREATE TABLE mastercard(
	bill_id INTEGER NOT NULL,
	country VARCHAR(20),
	state_province CHAR(2),
	city VARCHAR(20),
	street VARCHAR(30),
	zip_postalcode char(6),
	cardNumber CHAR(16),
	expiryDate CHAR(5),
	cvv CHAR(3),
	email VARCHAR(50),
	PRIMARY KEY(bill_id),
	FOREIGN KEY (email) REFERENCES customer(email) ON DELETE SET NULL
);

CREATE TABLE visa(
	bill_id INTEGER NOT NULL,
	country VARCHAR(20),
	state_province CHAR(2),
	city VARCHAR(20),
	street VARCHAR(30),
	zip_postalcode CHAR(6),
	cardNumber CHAR(16),
	expiryDate CHAR(5),
	cvv CHAR(3),
	email VARCHAR(50),
	PRIMARY KEY(bill_id),
	FOREIGN KEY (email) REFERENCES customer(email) ON DELETE SET NULL
);

CREATE TABLE category (
	cateName VARCHAR(20) NOT NULL,
	PRIMARY KEY (cateName)
);

CREATE TABLE product (
	pid INTEGER NOT NULL AUTO_INCREMENT,
	drugName VARCHAR(60) NOT NULL,
	unitPrice DOUBLE(9,2) NOT NULL,
	descShort VARCHAR(100) NOT NULL,
	descLong VARCHAR(1000) NOT NULL,
	stock INTEGER NOT NULL,
	pic_id INTEGER,
	PRIMARY KEY (pid),
	FOREIGN KEY (pic_id) REFERENCES picture(pic_id) ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE categoryincludes(
	cateName VARCHAR(20) NOT NULL,
	pid INTEGER NOT NULL,
	PRIMARY KEY (cateName, pid),
	FOREIGN KEY (cateName) REFERENCES category(cateName) ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY (pid) REFERENCES product(pid) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE review(
	timeposted DATETIME NOT NULL,
	revContent VARCHAR(1000),
	rating INTEGER NOT NULL,
	email VARCHAR(50),
	pid INTEGER,
	PRIMARY KEY(timeposted, email, pid),
	FOREIGN KEY (pid) REFERENCES product(pid) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (email) REFERENCES customer(email) ON DELETE CASCADE ON UPDATE CASCADE
);

CREATE TABLE cart(
	email VARCHAR(50) NOT NULL,
	pid INTEGER NOT NULL,
	price DOUBLE(9,2) NOT NULL,
	quantity INTEGER,
	PRIMARY KEY (email, pid),
	FOREIGN KEY (pid) REFERENCES product(pid) ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY (Email) REFERENCES customer(Email) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE orders(
	orderid INTEGER NOT NULL,
	totalPrice DOUBLE(9,2),
	email VARCHAR(50),
	orderDate datetime,
	PRIMARY KEY(orderid),
	FOREIGN KEY (email) REFERENCES customer(email) ON UPDATE CASCADE ON DELETE SET NULL
);

Create table inorder(
	orderid INTEGER NOT NULL,
	pid INTEGER NOT NULL,
	quantity INTEGER,
	price DOUBLE(9,2),
	Primary Key (orderid, pid),
	Foreign Key (orderid) references orders(orderid) ON UPDATE CASCADE ON DELETE CASCADE,
	Foreign Key (pid) references product(pid) ON UPDATE CASCADE ON DELETE CASCADE
);

